import React from "react";

const AddUser = ()=>{
    return(
        <div>
            <h2>Add User</h2>
            <form>
                <input  placeholder="enter name"/>
                <input  placeholder="enter age"/>
            </form>
        </div>
    )
}

export default AddUser;
